import logo from './logo.svg';
import './App.css';
import Calculator from './calculator';

function App() {
  return (
    <div className="App" padding="50px">
      <h1>Testing Environment</h1>
      <p>This is a basic program that will test if an number is changed correctly using
         simple calculator functionality.
      </p>
      <Calculator />
    </div>
  );
}

export default App;
